import "./App.css";
import Item from "./components/Item";
import ItemPrize from "./components/ItemPrize";

function App() {
  const item2name='SurfExel';
  return (
    <div className="App">
      <header className="App-header">
        <h1> Hello Jee</h1>

      <hr></hr>

      </header>

      <Item name='Nirma'></Item>
      <ItemPrize day='02' month='Oct' year='1919'></ItemPrize>
      <Item name={item2name}></Item>
      <ItemPrize day='28' month='Dec' year='1998'></ItemPrize>
      <Item name='Ghadi'></Item>
      <ItemPrize day='12' month='Nov' year='2002'></ItemPrize>


    </div>
  );
}

export default App;
